[Q]: What is the total number of unique patients for payer with id '123e4567-e89b-12d3-a456-426614174000'?
[SQL]: SELECT COUNT(DISTINCT p.id) FROM patients p JOIN encounters e ON p.id = e.patient JOIN payers pay ON e.payer = pay.id WHERE pay.id = '123e4567-e89b-12d3-a456-426614174000';

[Q]: What is the total number of unique patients for organization with id '123e4567-e89b-12d3-a456-426614174000'?
[SQL]: SELECT COUNT(DISTINCT p.id) FROM patients p JOIN encounters e ON p.id = e.patient JOIN organizations o ON e.organization = o.id WHERE o.id = '123e4567-e89b-12d3-a456-426614174000';

